import React from "react";
import ReactDOM from "react-dom/client";
function add(x,y){
    return x+y;
}
function Hello()
{
    return <h1>{add(10,5)} </h1>
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Hello/>);
